import pymysql
from pypmml import Model

# Fungsi untuk menghubungkan ke database
def create_connection():
    try:
        connection = pymysql.connect(
            host='localhost',
            database='decision_ml',  # Nama database Anda
            user='root',  # Username MySQL Anda
            password='tesdoang'  # Password MySQL Anda
        )
        if connection.open:
            print("Berhasil terhubung ke database")
            return connection
    except pymysql.MySQLError as e:
        print(f"Error: {e}")
        return None

# Fungsi untuk menambah data ke tabel products
def insert_product_data(connection, product_data, check_up_result_id):
    try:
        cursor = connection.cursor()

        insert_query = """
        INSERT INTO products (
            check_up_result_id, name, air, energi, protein, lemak, kh, serat, abu, kalsium, fosfor, besi, natrium, kalium, tembaga, seng, retinol, b_kar, kar_total, thiamin, riboflavin, niasin, vit_c, bdd
        ) VALUES (%s, %s, %s, %s, %s, %s, %s, %s, %s, %s, %s, %s, %s, %s, %s, %s, %s, %s, %s, %s, %s, %s, %s, %s) 
        """

        # Menyiapkan data untuk dimasukkan
        data_tuple = (
            check_up_result_id, product_data['name'], product_data['air'], product_data['energi'], product_data['protein'], 
            product_data['lemak'], product_data['kh'], product_data['serat'], product_data['abu'], product_data['kalsium'], 
            product_data['fosfor'], product_data['besi'], product_data['natrium'], product_data['kalium'], 
            product_data['tembaga'], product_data['seng'], product_data['retinol'], product_data['b_kar'], 
            product_data['kar_total'], product_data['thiamin'], product_data['riboflavin'], product_data['niasin'],
            product_data['vit_c'], product_data['bdd']
        )

        # Menjalankan perintah SQL
        cursor.execute(insert_query, data_tuple)
        connection.commit()
        print(f"Data {product_data['name']} berhasil ditambahkan")
    except Error as e:
        print(f"Gagal menambahkan data: {e}")
    finally:
        cursor.close()

# Fungsi prediksi untuk mendapatkan check_up_result_id
def predict_check_up_result(ml_model, product_data):
    prediction = ml_model.predict({
        "AIR (g)": product_data['air'],
        "ENERGI (Kal)": product_data['energi'],
        "PROTEIN (g)": product_data['protein'],
        "LEMAK (g)": product_data['lemak'],
        "KH (g)": product_data['kh'],
        "SERAT (g)": product_data['serat'],
        "ABU (g)": product_data['abu'],
        "KALSIUM (mg)": product_data['kalsium'],
        "FOSFOR (mg)": product_data['fosfor'],
        "BESI (mg)": product_data['besi'],
        "NATRIUM (mg)": product_data['natrium'],
        "KALIUM (mg)": product_data['kalium'],
        "TEMBAGA (mg)": product_data['tembaga'],
        "SENG (mg)": product_data['seng'],
        "RETINOL (mcg)": product_data['retinol'],
        "B-KAR (mcg)": product_data['b_kar'],
        "KAR-TOTAL (mcg)": product_data['kar_total'],
        "THIAMIN (mg)": product_data['thiamin'],
        "RIBOFLAVIN (mg)": product_data['riboflavin'],
        "NIASIN (mg)": product_data['niasin'],
        "VIT_C (mg)": product_data['vit_c'],
        "BDD (%)": product_data['bdd']})  # Sesuaikan dengan format input prediksi model Anda
    return prediction.get('predicted_Rekomendasi Produk')

